#include<bits/stdc++.h>
using namespace std;

struct hang {
    char mh[30];
    char th[30];
    char dv[30];
    float g;
    float sl;
};

struct node {
    hang infor;
    node *next;
};

typedef node* tro;

void nhaphang(hang &h) {
    cout << "Nhap ma: "; fflush(stdin); gets(h.mh);
    cout << "Nhap ten hang: "; fflush(stdin); gets(h.th);
    cout << "Nhap don vi: "; fflush(stdin); gets(h.dv);
    cout << "Nhap gia tien hang: "; cin >> h.g;
    cout << "Nhap so luong: "; cin >> h.sl;
}

void nhaplist(tro &l) {
    tro P, Q;
    hang x;
    int d = 0;

    l = NULL;
    do {
        nhaphang(x);
        P = new node;
        P->infor = x;
        P->next = NULL;
        if (l == NULL) {
            l = P;
        } else {
            Q->next = P;
        }
        Q = P;
        d++;
    } while (d < 3);
}

void xuat(tro l) {
    cout << "STT" << setw(15) << "Ma Hang" << setw(15) << "Ten Hang" << setw(15) << "Don Vi" << setw(15) << "Gia" << setw(15) << "So Luong" << setw(15) << "Thanh Tien" << endl;
    if (l == NULL) {
        cout << "Danh sach rong!" << endl;
        return;
    }
    tro Q = l;
    int i = 0;
    while (Q != NULL) {
        hang x = Q->infor;
        cout << i+1 << setw(15) << x.mh << setw(15) << x.th << setw(15) << x.dv << setw(15) << x.g << setw(15) << x.sl << setw(15) << x.g * x.sl << endl;
        Q = Q->next;
        i++;
    }
}

tro timvitri(tro l, int k) {
    int d = 1;
    tro Q = l;
    while (d < k - 1 && Q->next != NULL) {
        d++;
        Q = Q->next;
    }
    if (d < k - 1) {
        return NULL;
    }
    return Q;
}

void chendau(tro &l) {
    hang h;
    nhaphang(h);
    tro P = new node;
    P->infor = h;
    P->next = l;
    l = P;
}

void chenvt(tro &l, tro Q, hang h) {
    tro P = new node;
    P->infor = h;
    P->next = Q->next;
    Q->next = P;
}

void chenvtbky(tro &l, int k) {
    tro Q = timvitri(l, k);
    if (Q == NULL) {
        cout << "Khong the chen tai vi tri " << k << endl;
        return;
    }
    hang h;
    nhaphang(h);
    chenvt(l, Q, h);
}

void xoavtbk(tro &l, int k) {
    if (k == 1 && l != NULL) {
        tro temp = l;
        l = l->next;
        delete temp;
        return;
    }

    tro M = timvitri(l, k);
    if (M == NULL || M->next == NULL) {
        cout << "Khong the xoa tai vi tri " << k << endl;
        return;
    }

    tro Q = M->next;
    M->next = Q->next;
    delete Q;
}

tro timSLmax(tro l) {
    tro P = l;
    tro Q = l->next;
    while (Q != NULL) {
        if (Q->infor.sl > P->infor.sl) {
            P = Q;
        }
        Q = Q->next;
    }
    return P;
}


